              <div className='card-body'>
                
              <span className='card-number card-circle subtle'>
              12</span>
              <span className='card-author subtle' style={{color: "red"}}>
              Breakfast</span>

            <h2 className=''></h2>

                  </div>
         </div>
    </div>
   
  );
};

export default Restaurent
